import { CacheManageInfo } from '@/api/system/cacheManage'

export default {
  data() {
    return {
      visible: false,
      dataForm: {
        name: '',
        value: '',
      }
    }
  },
  methods: {
    init(id) {
      this.dataForm.name = id || ''
      this.visible = true
      this.$nextTick(() => {
        if (this.dataForm.name) {
          CacheManageInfo(this.dataForm.name).then(res => {
            this.dataForm = res.data
          }).catch(() => {
            this.visible = false
          })
        }
      })
    },
    goBack() {
      this.$emit('close')
    }
  }
}
